**2.15.0 Release Announcement**
Hello, today we are announcing 2.15.0! The key update is a new, stabilised API which allows validators to scale their API horizontally independently from their actual validator hardware. This is done by allowing validators to spin up multiple separate API servers which will forward spot checks of queries to the main validator. This also significantly accelerates the rate of inference.
The API allows access to all of SN1's text generation tasks like e.g. the Programming Task (high quality code completion), the QA task (factual question answering) and Inference (allows you to request completions using specific LLMs)

**For Miners**
No changes

**For Validators**
No changes are required, but you may wish to create (and charge for) API access to SN1. You can do this by following the instructions in validator_api/API_docs.md

**Changelog**
- Add separate API process to interface with miners (validator_api/api.py);
- Add .env.api config file for API settings;
- Add API docs at validator_api/API_docs.md;
- Add test query script (scripts/test_api.py);
- Moved prompting.Settings into shared.Settings to share config between validator and API;
- Fix DuckDuckGo rate-limits (prompting/base/duckduckgo_patch.py);
- Code clean up and other minor changes.

